import { Axios } from "axios";
import React, {Component} from "react";
// import {useState} from "react";

function Pokemon(){
  const options = {
    method: 'GET',
    headers: {
      'X-RapidAPI-Key': 'b32397f1fcmsh935c3b21d22db73p1ab1b6jsn93997ae9ae46',
      'X-RapidAPI-Host': 'pokemon-tcg-card-prices.p.rapidapi.com'
    }
  };

  fetch('https://pokemon-tcg-card-prices.p.rapidapi.com/card?setId=33ee55f4-30d0-4900-850f-36a351fb9719&set=vivid-voltage&series=sword-and-shield', options)
    .then(response => response.json())
    .then(response => console.log(response))
    .catch(err => console.error(err));
  return(
    <div>
      <p>Pokemon Cards</p>

    </div>
    )
  }

export default Pokemon;

const styles = {
  container: {
    alignContent: 'center',
    padding: '10rem'
  },
  img: {
    height: '30rem',
    width: '35rem',
    alignContent: 'center',
    marginRight: '1rem'

  },
  myArticle: {
    display: 'flex',
    flexDirection: 'column'
  },
  h3: {
    textAlign: 'center',
    marinTop: '1rem'
  }
}
